export default function MainNavigation({ className }) {
	return (
		<header className="bg-red-200 h-14">
			<navbar
				className={`flex justify-between items-center bg-green-200 h-full ${className}`}
			>
				<div>
					<h1 className="font-extrabold text-xl">Where in the World?</h1>
				</div>
				<div className="flex">
					<div>
						<span>0</span>
					</div>
					<div>
						<p>Dark Mode</p>
					</div>
				</div>
			</navbar>
		</header>
	);
}
